  componentDidMount() {
    getCustomerList()
  }

  constructor() {
    super();
    this.state = { test: 'Customer lists loading...', elements: [] }
  }

  getCustomerList() {
    var table = "";
    for (var i = 0; i < 5; i++) {
      table += `<section id="${i}"><h1>
      <Link
      to={{
      pathname: "/child",
      data-name = "jigar"
      }}>  <a href="/child"> Jigar</a> </Link>
        </h1><br>`;
    }

    this.setState({
      test: <div dangerouslySetInnerHTML={{ __html: table }} />
    })
  } 

  render() {
    return (
      <React.Fragment>
